import '../App.css';
import ReservoirData from './ReservoirData';
import reservoirIDs from '../constants/reservoirIDs';

function Main() {

    const resCards = reservoirIDs.map(res =>
        <ReservoirData
            id={res.id}
        />
    )

    const samples = [<h1>Yo friend</h1>, <h1>spare a croissant?</h1>, 3, 4, 5]

    return (
        <div className="App">
            <div className="App-background">
                {samples}
            </div>
        </div >
    );
}

export default Main;
